jQuery(document).ready(function(){marketplace.init()});marketplace=function(){return{init:function(){marketplace.addEvents(jQuery("body"))},addEvents:function(a){a=marketplace.addPhotosEvents(a);a=marketplace.addNavigationEvents(a);a.find("textarea").each(function(){marketplace_general.autoResizeTextarea(jQuery(this))});a.find(".package_input input").on("ifChecked",function(b){marketplace.showPackagePrice(jQuery(this),a)});return a},addNavigationEvents:function(a){a.find(".nav-advert-images-left").click(function(){marketplace_navigation.navigationClickNextEvent(jQuery(this))});a.find(".nav-advert-images-right").click(function(){marketplace_navigation.navigationClickPreviousEvent(jQuery(this))});return a},addPhotosEvents:function(a){a.find(".photos .photo").each(function(){marketplace_photos.photoClickEvent(jQuery(this))});return a},showPackagePrice:function(b,a){var c=b.val();a.find(".package_price_id .package_price_input").hide();a.find(".package_price_id .package_price_input input").iCheck("uncheck");a.find(".package_price_id .package_price_input_"+c).show().first().find("input").iCheck("check");console.log(a.find(".package_price_id .package_price_input_"+c).show().first().find("input"));jQuery(".package_changed").show()}}}();